this.fireTimer = function () {
	sdt = this.ui.get("TimerDetails2");
	sdt1 = this.ui.get("TimerDetails1");
	items = sdt1.getSelectedRecords();
			data1 = this.ui.get("../Data1");
		if (!items || items.length == 0) {
			data1.setValue(" Error: You have not selected any Timer Token Please select Token to continue" + new Date());
		}

	for (var i = 0; i < items.length; i++) {


		var xhrArgs = function (config) {
			return {
				url: "/rest/bpm/wle/v1/process/" + items[i].instanceID + "?action=fireTimer&timerTokenId=" + items[i].TimerTokenID + "&&parts=none",
				content: {
					accept: "application/json"
				},
				load: displayImage,
				handle: displayImage, 
				handleAs: "json"
			}
		}

		deferred = setTimeout(dojo.xhrPost(xhrArgs({
						inputs: {}
					})), i * 1000);
	}

	function displayImage(json_results) {
		if (json_results && json_results.status == "200") {
			data1.setValue(" Success: Fired " + items.length + "Timer(s)  " + new Date());
			sdt.refresh();
			sdt1.setAllRecordsSelected(false);
		}  else {
						if (json_results.responseText){
							var r = jQuery.parseJSON(json_results.responseText);
							data1.setValue(" Error: " + r.Data.errorMessage + new Date());
							data1.setValue(" Error: Not Fired" + items.length + " Timer(s)  " + "  " + json_results.Data.errorMessage);

						}else {
							data1.setValue(" Error:  Unknowon Error" +  new Date());
							data1.setValue(" Error: Not Fired" + items.length + " Timer(s)  " + "  " + json_results.Data.errorMessage);

						}
				}
		
	}

}
